import React, { useEffect, useState } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function FrontPage({user_cpu, user_gpu, user_ram, onChange}) {

  let id = "inputs";
  return (
        <div id={id}>
          <form>
            <label htmlFor='user_cpu'>User CPU</label><br/>
            <input
                type='text'
                id='user_cpu'
                name='user_cpu'
                placeholder='Enter your CPU here'
                value={user_cpu}
                onChange= {onChange}
            />
            <br/>
            <label htmlFor='user_gpu'>User GPU</label><br/>
            <input
                type='text'
                id='user_gpu'
                name='user_gpu'
                placeholder='Enter your GPU here'
                value={user_gpu}
                onChange= {onChange}
            />
            <br/>
            <label htmlFor='user_ram'>User RAM</label><br/>
            <input
                type='text'
                id='user_ram'
                name='user_ram'
                placeholder='Enter your RAM here'
                value={user_ram}
                onChange= {onChange}
            />
            <br/>
            <input type='submit' value='Submit' />
          </form>
        </div>
  );
}

export default FrontPage;
